import { NavLink } from 'react-router-dom';

export default function Navbar() {
  return (
    <nav style={styles.nav}>
      <NavLink to="/" style={styles.link} end activeStyle={styles.activeLink}>
        Home
      </NavLink>
      <NavLink to="/movies" style={styles.link} activeStyle={styles.activeLink}>
        Movies
      </NavLink>
      <NavLink to="/about" style={styles.link} activeStyle={styles.activeLink}>
        About
      </NavLink>
    </nav>
  );
}

const styles = {
  nav: {
    backgroundColor: '#003366', 
    padding: '10px 20px',
    display: 'flex',
    gap: '20px',
  },
  link: {
    color: 'white',
    textDecoration: 'none',
    fontWeight: 'bold',
  },
  activeLink: {
    textDecoration: 'underline',
    color: '#ffa500', 
  },
};
